import React from 'react'

let test = {
    "color": "#40C5FF",
    "font-size": "15px"
}
const ColumnNames = () => (
    
       <div>
            <span className={test}>Actions</span>
            <span>Map Name</span>
            <span>Team ID 1</span>
            <span>Team ID 2</span>
            <span>Attacking Team</span>
            <span>Warnings</span>
        </div>
)

export default ColumnNames;
